// pages에 포함된 모든 페이지의 공통된 사항을 처리 가능.
import React from 'react';
import 'antd/dist/antd.css';
import propTypes from 'prop-types';

const App = ({ Component }) => {
  return (
    <>
      <div>공통 메뉴</div>
      <Component />
    </>
  )
};

App.propTypes = {
  Component : propTypes.elementType.isRequired,
}

export default App;
